import leetcode.WildcardMatching;
import org.junit.Test;
import sun.reflect.generics.tree.Wildcard;

import java.util.Arrays;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

/**
 * Created by Patrick on 15/5/14.
import org.junit.Test;

import java.util.Arrays;
import java.util.HashMap;
import java.util.List;
import java.util.Map;
 */
public class TestWildcardMatching {
    WildcardMatching w = new WildcardMatching();

    @Test
    public void testBasic() throws Exception {
        String str = "a";
        String s = str.substring(1);
        assert s != null;
        assert s.length() == 0;

        assert "ab".substring(0).equals("ab");
        assert "ab".substring(1).equals("b");
        assert "ab".substring(2).equals("");

        Map<List<String>, Boolean> map = new HashMap<List<String>, Boolean>();
        map.put(Arrays.asList("asdf", "asdf"), true);
        assert map.get(Arrays.asList("asdf", "asdf"));
    }

    @Test
    public void testSample() throws Exception {
        assert !w.isMatch("aa","a");
        assert w.isMatch("aa","aa");
        assert !w.isMatch("aaa","aa");
        assert w.isMatch("aa", "*");
        assert w.isMatch("aa", "a*");
        assert w.isMatch("ab", "?*");
        assert !w.isMatch("aab", "c*a*b");
    }

    @Test
    public void testRec() throws Exception {
        assert !w.isMatch("aa","a");
    }

    @Test
    public void testError2() throws Exception {
        assert w.isMatch("hi", "*?");
    }

    @Test
    public void testTLE22() throws Exception {
        assert w.isMatch("abefcdgiescdfimde", "ab*cd?i*de");
        assert !w.isMatch("", "c");
        assert !w.isMatch("", "?");
        assert w.isMatch("", "*");
        assert w.isMatch("abefcdgiescdfimde", "ab*cd?i*de");
    }

    @Test
    public void testError() throws Exception {
        assert w.isMatch("aa", "*");
    }

    @Test
    public void testTLE() throws Exception {
        String a = "bbbbabbabbabbababbbaaaabbbaaabbbaaababbbbbaabbaaaaaaaabbbaabbbabbbabababaabbbabaabaababaabbbaaaabbbbaabbaaaaaaaabaabaababbbabaaabbbbbaaabbabbaaaaabbabbaababbabababbbababbbabbabaaaabaabbaaaabaabbbabaaa";
        String b = "**a*bb**b****a**bbb*abb**a***a*b***aa**bbb**********aa**aaa*b*a**a*****aa***abb*aa*aaa*ab****abaab**a";
        assert w.isMatch(a, b);
    }

    @Test
    public void testTLE2() throws Exception {
        String a = "";
        String b = "";
        assert !w.isMatch(a, b);

    }

    @Test
    public void testTLE3() throws Exception {
        String a = "abbaabbbbababaababababbabbbaaaabbbbaaabbbabaabbbbbabbbbabbabbaaabaaaabbbbbbaaabbabbbbababbbaaabbabbabb";
        String b = "***b**a*a*b***b*a*b*bbb**baa*bba**b**bb***b*a*aab*a**";
        assert w.isMatch(a, b);
    }

    @Test
    public void testTLE4() throws Exception {
        String a = "aabbbbaaaaaaaabbbabbaabbbbbbaabaaabbbabbaabaaabababbaabababbaaaaababbbbbbababaaabbbbbabbbaabaaaaaaabbbbbbababbaaaabbababbbbabbabbabababbaabbbabbabbaabababbaaabbaabaabbbbaabaaaabbbbbbabaabaabbabaaabbbbab";
        String b = "a**abaaa******a*b*ba**aba***b*bbbab*bb*aab**a*bba*b*abab**aabbb***a*a**b**a*abab*ba**aa**b***aba*b****a*";
        assert w.isMatch(a, b);
    }

    @Test
    public void testTLE5() throws Exception {
        String a = "aaabbaabbbbbaabbbabbbaaabbbaaaabaaabaaaabbbbaabbbabaababababbaabbaabbbbaabaabbaabbaaaabbbbaaaabbaaabbaabbaaabababbabaaabbaabababbbaabaaaaaabababbaababaababaaabbbbaaaaaaaaaaaabbababaababaabababaabaabbaaba";
        String b = "*bb*bb*****b******a**ab*bba****ba*a*a*aa*abb*baa*a**ba**b*ba**b**ba*ab**bb***a*ba*ab****ab**aab*bb*b";
        assert !w.isMatch(a, b);
    }

    @Test
    public void testCase() throws Exception {
        assert w.isMatch("abcdfsdfe", "a***e");
    }

    @Test
    public void testTLE6() throws Exception {
        String a = "";
        String b = "**";
        assert !w.isMatch(a, b);
    }

    @Test
    public void testTLE7() throws Exception {
        String a = "";
        String b = "**";
        assert !w.isMatch(a, b);
    }
}
